Category	Feature, Couples, Sweet Sinner's Swinger Series

Director	James Avalon
Starring	India Summer, Chanel Preston, Mr Pete, John Strong, Steven St Croix, Veronica Avluv, Marcus London, Adrianna Luna

A real estate agent discovers that her new clients, a charmingly cultured couple, are brazenly open about their swinging lifestyle. She's taken aback for a moment. Then thinks about it. She's worked hard her whole life. Married her high school sweetheart. Could there be more in the way of sexual adventure for her? Or is it too late? She decides to find out. She's invited to a party, but wants to discuss things with her husband first. As it turns out, he's disgusted by the whole idea. Feeling that she deserves more, she goes ahead on her own, and soon discovers an intoxicating, sexual world she never realized existed before. Starring India Summer as the naive real estate agent, and Veronica Avluv with Marcus London as the purveyors of the swinging!

